import "./Tours.css"
// import data from "./data/data.json";
import { Link } from "react-router-dom";


const Tours = ({ props }) => {
  return (
    <div className='tour-list'>
      {
        props.map((tour) => (
          <div className='tour-preview' key={tour.id}>
            <Link to={`/tour/${tour.id}`}>
              <Tour tour={tour} />
            </Link>
          </div>
        ))}
    </div>
  );
};
export default Tours;
